  `id` int(11) NOT NULL AUTO_INCREMENT,
  `attachId` int(11) DEFAULT NULL,
  `categoryId` int(11) DEFAULT NULL,
  `userId` int(11) DEFAULT NULL,
  `status` tinyint(2) unsigned NOT NULL DEFAULT '0',
  `name` varchar(255) DEFAULT NULL,
  `cTime` int(11) unsigned DEFAULT NULL,
  `mTime` int(11) unsigned DEFAULT NULL,
  `thumb` varchar(255) DEFAULT NULL,
  `info` text,
  `commentCount` int(11) unsigned DEFAULT '0',
  `readCount` int(11) unsigned DEFAULT '0',
  `fcode` varchar(16) DEFAULT NULL,
  `serverpath` varchar(100) DEFAULT NULL,
  `filename` varchar(100) DEFAULT NULL,
  `outfilename` varchar(100) DEFAULT NULL,
  `savepath` varchar(255) DEFAULT NULL,
  `size` int(11) NOT NULL DEFAULT '0',
  `flvsize` int(11) NOT NULL DEFAULT '0',
  `privacy` int(1) NOT NULL DEFAULT '1',
  `tags` text,
  `order` int(11) NOT NULL DEFAULT '0',
  `isDel` tinyint(1) NOT NULL DEFAULT '0',
  `errcount` int(11) DEFAULT NULL,
  `times` int(11) DEFAULT NULL,
  `autoimg` varchar(11) DEFAULT NULL,
  `filetype` varchar(20) DEFAULT NULL,
  `orgin` tinyint(1) DEFAULT '0',
  `square_id` int(11) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=16050 DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS ts_video_category;
CREATE TABLE `ts_video_category` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `userId` int(11) DEFAULT NULL,
  `name` varchar(255) DEFAULT NULL,
  `info` text,
  `cTime` int(11) unsigned DEFAULT NULL,
  `mTime` int(11) unsigned DEFAULT NULL,
  `coverImageId` int(11) DEFAULT NULL,
  `coverImagePath` varchar(255) DEFAULT NULL,
  `videoCount` int(11) DEFAULT '0',
  `readCount` int(11) DEFAULT '0',
  `status` tinyint(2) unsigned NOT NULL DEFAULT '1',
  `isHot` varchar(1) NOT NULL DEFAULT '0',
  `rTime` int(11) NOT NULL DEFAULT '0',
  `share` tinyint(1) NOT NULL DEFAULT '0',
  `privacy` tinyint(1) DEFAULT NULL,
  `privacy_data` text,
  `isDel` tinyint(1) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`),
  KEY `uid` (`userId`) USING BTREE,
  KEY `cTime` (`cTime`) USING BTREE,
  KEY `mTime` (`mTime`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=653 DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS ts_video_index;
CREATE TABLE `ts_video_index` (
  `categoryId` int(11) NOT NULL DEFAULT '0',
  `videoId` int(11) NOT NULL DEFAULT '0',
  `userId` int(11) DEFAULT NULL,
  `order` int(11) DEFAULT NULL,
  `privacy` tinyint(1) NOT NULL DEFAULT '1',
  PRIMARY KEY (`categoryId`,`videoId`),
  UNIQUE KEY `category_video` (`categoryId`,`videoId`) USING BTREE
) ENGINE=MyISAM DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS ts_video_mark;
CREATE TABLE `ts_video_mark` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `videoId` int(11) DEFAULT NULL,
  `userId` int(11) DEFAULT NULL,
  `userName` varchar(50) DEFAULT NULL,
  `markedUserId` int(11) DEFAULT NULL,
  `x` varchar(100) DEFAULT NULL,
  `y` varchar(100) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS ts_video_server;
CREATE TABLE `ts_video_server` (
  `serverid` int(11) NOT NULL AUTO_INCREMENT,
  `servername` varchar(50) DEFAULT NULL,
  `serverurl` varchar(255) DEFAULT NULL,
  `isrun` int(11) DEFAULT NULL,
  `groupid` varchar(255) DEFAULT NULL,
  `envideo` int(11) DEFAULT NULL,
  `endoc` int(11) DEFAULT NULL,
  `uploadurl` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`serverid`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS ts_vote;
CREATE TABLE `ts_vote` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
